Our Rust code sets up an Arcon pipeline, which contains the Arc-Script pipeline, and passes it a vector of integers as input. The resulting stream is displayed in the console. Note that this code will in the future be abstracted away when building applications with Arc-Script. $ cat arc-template/src/main.rs use arc_script::arcorn::operators::*;
use arcon::prelude::{ArconTime, Pipeline}; mod script { // Include and encapsulate the Arc-Script inside a Rust module arc_script::include!("src/main.rs");
} fn main() { // Setup an arcon pipeline let pipeline = Pipeline::default(); // Create a data stream source let data = vec![1, 2, 3]; let stream = pipeline .collection(data, |conf| { conf.set_arcon_time(ArconTime::Process); }) .convert(); // Connect the data stream with the arc-script let stream = script::pipe(stream); // Connect the data stream with a sink let mut pipeline = stream.to_console().build(); // Execute the pipeline pipeline.start(); pipeline.await_termination();
} Any code written inside Rust can also be included into the Arc-Script. This will be covered in the language reference.

