Scan is a task which is a combination of Map and Reduce. It maintains an aggregate and outputs it for each aggregated element. task Scan[A, T](init: A, f: fun(A, T): A): ~T -> ~A { var agg = init; on event => { agg = f(agg, event); emit agg }
} Implicitly, the above desugars to: task Scan[A, T](init: A, f: fun(A, T): A): ~T -> ~A { val agg = Cell(init); on event => { agg.set(f(agg.get(), event)); emit agg.get() }
}

