Timeouts allow the definition of session windows . For example: # A window which outputs an aggregate (and resets) after a timeout of not receiving events.
task SessionWindow[A,T](init: A, dur: duration, binop: fun(A, T): A) ~T -> ~A { var agg = init; on { event => agg = binop(agg, event), after dur => { emit agg; agg = init } }
}

