TakeUntil is a task which forwards events of a stream until a predicate is satisfied. task TakeUntil[T](p: fun(T): bool): ~T -> ~T { on event => if p(event) { exit } else { emit event }
} # Take until a number above 100 is encountered
fun test(s: ~i32): ~i32 { TakeUntil(fun(x): x > 100) (s)
}

