Fold is a task which aggregates a stream into a single value. task Fold[A,T](init: A, f: fun(A, T): A): ~T -> A { var agg: A = init; on { event => agg = f(agg, event), done => exit agg }
} # Calculate the average of a stream
fun avg(s: ~i32): i32 { val sum = Fold(0, fun(a,x): a + x) (s); val count = Fold(0, fun(a,_): a + 1) (s); sum / count
}

