KeyBy changes the key of a stream from K0 to K1 through function f. shuffle task KeyBy[V, K0, K1](f: fun(V): K1) ~V by K0 -> ~V by K1 { on event by old_key => emit event by f(event)
} An example of how to use KeyBy: shuffle fun test(s: ~i32 by i32): ~i32 by i32 { s |> KeyBy(fun(x): x % 50) # Re-shuffle into 50 key groups |> KeyBy(fun(x): x % 10) # Re-shuffle into 10 key groups
}

