Map changes the value of a stream from V0 to V1 through function f, while leaving the key untouched. task Map[V0, V1](f: fun(V0): V1) ~V0 -> ~V1 { on event => emit f(event)
} An example of how to use KeyBy: fun test(s: ~i32): ~i32 { s |> Map(fun(x): x + 1) |> Map(fun(x): x - 1)
} Implicitly, the above will desugar into a generic keyed function: shuffle fun test[K](s: ~i32 by K): ~i32 by K { s |> Map(fun(x): x + 1) |> Map(fun(x): x - 1)
}

